import React from 'react';
import {BrowserRouter as Router,Switch,Route, Link} from 'react-router-dom';
import about from './about';

function HomePage(props) {
    return (
        <div>
            <a href={about}>Banking System</a>
        </div>
    );
}

export default HomePage;
